import React, { Component } from 'react'

export default class FacebookIcon extends Component {
  render() {
    return (
        <div className="sharing_bg">
      <svg className="sharing_icon"  xmlns="http://www.w3.org/2000/svg" width="20" height="20" viewBox="0 0 264 512" aria-labelledby="title">
	<title id="title">Facebook Icon</title>
        <path fill="currentColor" d="M215.8 85H264V3.6C255.7 2.5 227.1 0 193.8 0 124.3 0 76.7 42.4 76.7 120.3V192H0v91h76.7v229h94V283h73.6l11.7-91h-85.3v-62.7c0-26.3 7.3-44.3 45.1-44.3z"/>
      </svg>
      </div>
    )
  }
}
